import { useState } from 'react';
import './global.css';
import Atom from './pages/Atom';
import Mike from './pages/Mike';

// Define the available pages
type PageType = 'home' | 'mike' | 'atom';

interface PageInfo {
  id: PageType;
  title: string;
  description: string;
  emoji: string;
}

const pages: PageInfo[] = [
  {
    id: 'mike',
    title: 'Mike Page',
    description:
      'Japanese auction platform with responsive design and CSS modules',
    emoji: '🏢',
  },
  {
    id: 'atom',
    title: 'Atom Page',
    description:
      'Japanese auction platform with responsive design and CSS modules',
    emoji: '⚛️',
  },
];

function App() {
  const [currentPage, setCurrentPage] = useState<PageType>('home');
  const { theme, setTheme } = useTheme();

  const navigateToPage = (pageId: PageType) => {
    setCurrentPage(pageId);
  };

  const toggleTheme = () => {
    setTheme(prev => (prev === 'light' ? 'dark' : 'light'));
  };

  const renderCurrentPage = () => {
    switch (currentPage) {
      case 'mike':
        return <Mike />;
      case 'atom':
        return <Atom />;
      default:
        return (
          <div style={{ padding: '2rem', textAlign: 'center' }}>
            <header
              style={{
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center',
                marginBottom: '2rem',
              }}
            >
              <div>
                <h1>🚀 React App</h1>
                <p>Choose a page to navigate to:</p>
              </div>
              <button
                onClick={toggleTheme}
                style={{
                  background: 'none',
                  border: '2px solid var(--primary-color, #f78c23)',
                  color: 'var(--primary-color, #f78c23)',
                  padding: '0.5rem 1rem',
                  borderRadius: '8px',
                  cursor: 'pointer',
                  fontWeight: '600',
                  fontSize: '1.2rem',
                  display: 'flex',
                  alignItems: 'center',
                  gap: '0.5rem',
                }}
                title={`Switch to ${theme === 'light' ? 'Dark' : 'Light'} mode`}
              >
                {theme === 'light' ? '🌙' : '☀️'}
                {theme === 'light' ? 'Dark' : 'Light'}
              </button>
            </header>

            <div
              style={{
                display: 'grid',
                gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
                gap: '2rem',
                marginTop: '2rem',
              }}
            >
              {pages.map(page => (
                <div
                  key={page.id}
                  onClick={() => navigateToPage(page.id)}
                  style={{
                    border: '2px solid var(--primary-color, #f78c23)',
                    borderRadius: '12px',
                    padding: '2rem',
                    cursor: 'pointer',
                    transition: 'transform 0.2s ease',
                    backgroundColor: theme === 'dark' ? '#2d3748' : 'white',
                    color: theme === 'dark' ? 'white' : 'black',
                  }}
                  onMouseEnter={e => {
                    e.currentTarget.style.transform = 'translateY(-4px)';
                  }}
                  onMouseLeave={e => {
                    e.currentTarget.style.transform = 'translateY(0)';
                  }}
                >
                  <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>
                    {page.emoji}
                  </div>
                  <h2
                    style={{
                      margin: '0 0 1rem 0',
                      color: 'var(--primary-color, #f78c23)',
                    }}
                  >
                    {page.title}
                  </h2>
                  <p
                    style={{
                      margin: '0',
                      color: theme === 'dark' ? '#e2e8f0' : '#666',
                    }}
                  >
                    {page.description}
                  </p>
                </div>
              ))}
            </div>
          </div>
        );
    }
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        backgroundColor: theme === 'dark' ? '#1a202c' : 'white',
        color: theme === 'dark' ? 'white' : 'black',
        transition: 'background-color 0.3s ease, color 0.3s ease',
      }}
    >
      {currentPage !== 'home' && (
        <nav
          style={{
            padding: '1rem',
            borderBottom: `1px solid ${theme === 'dark' ? '#4a5568' : '#e2e1da'}`,
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
          }}
        >
          <button
            onClick={() => setCurrentPage('home')}
            style={{
              background: 'none',
              border: '2px solid var(--primary-color, #f78c23)',
              color: 'var(--primary-color, #f78c23)',
              padding: '0.5rem 1rem',
              borderRadius: '8px',
              cursor: 'pointer',
              fontWeight: '600',
            }}
          >
            ← Back to Home
          </button>
          <button
            onClick={toggleTheme}
            style={{
              background: 'none',
              border: '2px solid var(--primary-color, #f78c23)',
              color: 'var(--primary-color, #f78c23)',
              padding: '0.5rem 1rem',
              borderRadius: '8px',
              cursor: 'pointer',
              fontWeight: '600',
              fontSize: '1.2rem',
              display: 'flex',
              alignItems: 'center',
              gap: '0.5rem',
            }}
            title={`Switch to ${theme === 'light' ? 'Dark' : 'Light'} mode`}
          >
            {theme === 'light' ? '🌙' : '☀️'}
          </button>
        </nav>
      )}

      <main>{renderCurrentPage()}</main>
    </div>
  );
}

export default App;

